import React from 'react'
import { NaverMap } from 'react-naver-maps'
import Marker from './Marker'

class App extends React.Component {
  render () {
    return (
      <div>
        <h1>NoKiz</h1>
        <NaverMap 
          style={{
            width: '80%',
            height: '600px',
          }}

          defaultCenter={{ lat: 37.3595704, lng: 127.17002399 }}
          defaultZoom={10}
        />
      </div>
    )
  }
}


export default App
